import { Component } from "react";

export default class LoggingOut extends Component {
  constructor() {
    this.state = {
      redirect: false,
    };
  }
  leaveOrStay = (leave) => {
    if (leave) {
      this.setState({ redirect: true });
    }
  };
  render() {
    return (
      <div>
        <h1>
          Are you sure you want to log out ?
          <button
            onClick={(event) => {
              this.leaveOrStay(true);
            }}
          >
            yes
          </button>
          <button
            onClick={(event) => {
              this.leaveOrStay(false);
            }}
          >
            no
          </button>
        </h1>
      </div>
    );
  }
}
